import './App.css';
import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function App() {
  return (
    <div>
      <body className="App-header">
        <div class="dropdown">
          <FontAwesomeIcon icon="fa-solid fa-plus" />
        </div>
      </body>
    </div>
  );
}

export default App;
